import React from "react";
import ReactDOM from "react-dom";

import Card from "./Card.jsx";
import sdata from "./Sdata.jsx";

function ncards(val){
return(
<Card 
    name={val.name}
    Rollno={val.rollno}
    Course={sdata[0].course}

/>
);
}

ReactDOM.render(
<> 

{sdata.map(ncards)}
 </>,
  document.getElementById("root")
);
